import './App.css';
import Navbar from './components/Navbar';
import {Routes, Route} from 'react-router-dom';
import Home from './pages/Home';



function App() {
  return (
    <div className="App">
    <Navbar/>
    <Routes>
      <Route exact path = '/' element={<Home/>} />
    </Routes>
    </div>
  );
}

export default App;
